import { Box, Container } from '@mui/system';
import React from 'react';
import { 
    FormControlLabel,
    Checkbox,
    } from '@mui/material';

// const Checkbox =() =>{
//     <Checkbox />
// }

const Checkout = () => {
  return (
    <Container>
        <FormControlLabel
          value="selectAll"
          control={<Checkbox />}
          label="Pilih Semua"
          labelPlacement="end"
          sx={{
            gap:'35px',
            mt:'40px'
          }}/>

        <Box
        display='flex'
        flexDirection='column'
        height='157px'
        borderBottom='1px solid black'
        >

        </Box>
    </Container>
  )
}

export default Checkout
